import NavTab from '../NavTab/NavTab';

function BurgerMenu() {
    return (
        <section className='burger-menu'>
            <div className='burger-menu__container'>
            <button
            type="button"
            className="burger-menu__close"
            // onClick={onClose}
          ></button>
        <NavTab/>
            </div>
        </section>
    );
}

export default BurgerMenu;
